export default {
  clearArticles(state) {
    state.selectedCategory = []
    state.unSelectedCategory = []
    state.categorysId = null
    state.articleList = {}
    state.authorArticle = {}
  },
  setSelectedCategory(state, data) {
    state.selectedCategory = data
  },
  setUnSelectedCategory(state, data) {
    state.unSelectedCategory = data
  },
  setCategorysId(state, data) {
    state.categorysId = data
  },
  updateArticleList(state, data) {
    state.articleList = data
  },
  updateAuthorArticle(state, data) {
    state.authorArticle = data
  }
}
